package main

import (
	"fmt"
	"strings"
)

func lengthOfLongestSubstring(s string) int {
	s = strings.ToLower(s)
	var result, current int
	for i := 0; i < len(s); i++ {
		seen := make(map[byte]bool)
		current = 0
		for j := i; j < len(s); j++ {
			if seen[s[j]] == true {
				break
			}
			seen[s[j]] = true
			current++
		}
		if current > result {
			result = current
		}
	}
	return result
}

